import React from "react";

const Monday = () => {
  return (
    <div>
      <input type="text" placeholder="Workout" />
      <h1> Monday </h1>
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
};

export default Monday;
